import React from "react";

const Profile = () => {
  const niceBall = () => {
    alert('yosh')
  };

  return (
    <>
      <h1 className="name">Profile</h1>
      <div className="portfolio">
        <button
          className="timeBtn btn btn-outline-secondary"
          onClick={niceBall()}
        >
          Change time zone
        </button>
      </div>
    </>
  );
};

export default Profile;
